import React, { useEffect, useState } from 'react';
import axios from 'axios';
import BCSCard from './BCSCard';
import bcs from '../assets/better-call-saul.jpeg';
import '../styles/Series.css';

export default function Series() {
    const [ BCSList, setBCSList ] = useState ([]);

    useEffect(() => {
        axios
            .get('https://tarea-1-breaking-bad.herokuapp.com/api/episodes?series=Better+Call+Saul')
            .then(response => {
                console.log(response.data);
                setBCSList(response.data);
            })
            .catch(err => {
                console.log(err)
            })
    }, [])

    var seasons = [];
    for (var key in BCSList) {
        if (seasons.includes(parseInt(BCSList[key].season))) {
            // pass
        } else {
            seasons.push(parseInt(BCSList[key].season))
        } 
    }

    return(
        <section className='characters-list'>
            <h2>Breaking Bad</h2>
            <img src={bcs} alt="imagen"></img>
            {seasons.map((value, id) => {
                return <BCSCard value={value} id={id} />
            })}
        </section>
    )
}
